import React from "react";
import banner from "../Images/banner.png";

const MainCom = () =>{
    return(
        <div className="main_comp">
        <img src={banner} alt="Banner" />
        <div className="text">
            <h2>Products</h2>
            <p>Home/<span>Products</span></p>
        </div>


        </div>

    )
}
export default MainCom;
